import React from 'react';
import kws from '../images/clients/ebaylogo.png';
import geps from '../images/clients/amazon.png';
import protergia from '../images/clients/protergia.png';

const clientImage = {
    height: '10rem',
    width: 'auto',
    mixBlendMode: 'colorBurn',
};

const Clients = () => {
    return (
        <div className="mt-8 bg-gray-100 flex flex-col items-center"> {/* Adjusted for vertical alignment */}
            <section data-aos="fade-up">
                <div className="my-4 py-4 text-center"> {/* Centered text */}
                    <h2 className="my-2 text-3xl text-blue-900 uppercase font-bold">Our Clients</h2>
                    <div className='my-2'>
                        <div className='w-24 mx-auto border-b-4 border-blue-900'></div>
                    </div>
                    <h2 className="mt-4 text-xl lg:text-2xl font-semibold text-blue-900">Some of our clients.</h2>
                </div>
            </section>

            <div className="p-16" data-aos="fade-in" data-aos-delay="600">
                <div className="grid sm:grid-cols-3 gap-4 justify-center items-center"> {/* Adjusted for image alignment and responsiveness */}
                    <div className="opacity-50 hover:opacity-100 transition-all ease-in-out">
                        <img src={kws} alt="client" style={clientImage} />
                    </div>
                    <div className="opacity-50 hover:opacity-100 transition-all ease-in-out">
                        <img src={geps} alt="client" style={clientImage} />
                    </div>
                    <div className="opacity-50 hover:opacity-100 transition-all ease-in-out">
                        <img src={protergia} alt="client" style={clientImage} /> {/* Assuming you want to include this third image */}
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Clients;
